class Artefact {
	constructor(rune_id, rune_quantity, artefact_array) {
		this.rune = rune_id
		this.rune_quantity = rune_quantity
		this.artefacts = artefact_array
	}

	sumPrices(itemmap, city) {
		var total = 0
		this.artefacts.forEach(artefact => {
			total = total + itemmap.getPrice(artefact,1,city)
		})
		return total
	}

	averagePrice(itemmap, city) {
		return this.sumPrices(itemmap, city)/this.artefacts.length
	}

	profit(itemmap, start, end, tax){
		return this.averagePrice(itemmap, end) * (1 - tax) - itemmap.getPrice(this.rune,1,start) * this.rune_quantity
	}

	artefactSpan(itemmap, city) {
		var string = "<div class=\"tooltip\">Hover for Artifact Prices<span class=\"tooltiptext\">"
		this.artefacts.forEach(artefact => {
			string = string + ITEM_NAMES.get(artefact) + ": " + itemmap.getPrice(artefact,1,city) + "<br>"
		})
		return string + "</span></div>"
	}

	createTableRow(itemmap, start, end, tax) {
		var string = "<tr><td class=\"enchant\">0</td><td><div class=\"tooltip\">"+ITEM_NAMES.get(this.rune)+"<span class=\"tooltiptext\">Price: "+itemmap.getPrice(this.rune,1,start)+"</span></div></td><td>"+this.rune_quantity+"</td><td class=\"profit\">"
		+Math.trunc(this.profit(itemmap,start,end,tax))+"</td><td>"+this.artefactSpan(itemmap, end)+"</td>"
		return string
	}
}

